INSERT INTO `t_fw_user` VALUES ('223', '2', '111', '111', '0', '111', '', '13699999999', '9999', '\n女孩爱上不该爱的人清醒要趁早\n\n 2016-06-14 13:42:43 \n\n标签：感情恋情失恋不该爱老男人\n    \n\n她是一名大学生，还没有毕业，却因为暑期兼职，认识了一个比她大10岁左右的男人，那时候，他告诉她，他没有女朋友。于是，她和他开始了交往。\n\n后来，却知道他有女友，他骗了她。她想分手，却发现自己很喜欢他，于是爱恨交加，不明不白地纠缠。\n\n他买房了，有次还贷，他朝她借钱。可是，房产上却写了女友的名字，他没有告诉过她。她知道真相后，很是伤心难过。\n\n得不到他的爱，却在不知觉中帮助他建立自己的家庭。她很不甘心。\n\n他挣得的钱几乎全部都给女友了，而她并不在乎他的钱，只是觉得这样倒贴一个大自己10岁的男人真心不值。她觉得那个女人不爱他，而他却深深爱着那个女人。\n\n她有时候，有点清醒，知道自己不可能会嫁给他，别说他不和女友分手，即便分手，她也可能不会嫁给他，她心里有了心结，有了芥蒂。\n\n可是，她又很矛盾。她觉得自己爱他，不想离开他，甚至有时候，还想帮助他，不见的时候，又很想他。而他，在女朋友不在的时候，主动联系她，女友在的时候，不去理她。她为此和他吵过，闹过，让他说绝情的话给自己，他也总是不说，她不知道该怎么办了？\n\n我的回复：\n\n这种感情，基本上没有爱，只是一方的心理障碍。如果，深究原因，一定跟这个女孩的原生家庭的成长环境有关，喜欢大自己很多的男人。其实，往往都是被自己感动了，至于那个男人，做他的眼里，这样的女孩或许是傻，是单纯。所以，他就利用这种单纯，去欺骗一个不懂感情却深陷感情漩涡的女人。\n\n他有自己爱的人，却在自己爱的人面前，找不到自信，一味付出，得到的回报依然很少，所以，内心是不平衡的，是想得到更多的关怀的，所以遇到她，还没有大学毕业，迷恋自己，所以，就享受于这种被人爱的世界。\n\n她很清醒自己和他没有未来，却仍然无法走出这种关系，其实，已经失去了男女朋友的意义，更多的是一种精神上的寄托，是对爱的一种幻想，他只是她的爱的世界里的一个符号化的人而已。\n\n所以，该让自己清醒一下了，不要沉湎于这种不被珍惜的感情。不要被自己的爱欺骗，而一味付出，一旦受伤害，你才会醒来，但很痛，却为时已晚。所以，清醒要趁早。​\n评论丨高铁要不要提速 到底该听谁的？(2016-06-14 20:34:40)转载▼标签： 杂谈  \n评论丨高铁要不要提速 <wbr>到底该听谁的？ \n\n近期，高铁是否恢复350公里的运行速度成为了大家热议的话题。面对各界呼声，中国铁路总公司高层表示，\\“高铁提速是经济问题，技术上没有问题，但经济上是否合理，需要充分论证。”\n\n\n\n其实，铁路发展也并非一帆风顺，也经历过从提速到降速的过程：\n\n\n评论丨高铁要不要提速 <wbr>到底该听谁的？\n\n△数据来源：人民网\n\n\n高铁如果再次提速，有哪些考量的因素？提速是否又意味着票价上涨呢？\n\n\n央视评论\n\n\n高铁提速焦点从\\“技术性\\”转移到\\“经济账\\”\n\n\n\n高铁提速需顺应国情的发展需求，综合考虑安全、技术、经济等多方面的因素。\n从技术上看，现在提速完全具备条件。提速也是对中国高铁技术安全性和便捷性的一次展示，有利于在国际上打造“中国高铁”的良好形象，推动高铁技术\\“走出去\\”。\n\n\n技术上没有问题，但安全是否可以保障、经济上是否合理，还要算算账。时速300公里提到350公里，势必会造成运营成本上涨，这可是真金白银的问题，如何在速度与安全、成本与效益之间找到平衡点，需要进行反复衡量。\n\n\n评论丨高铁要不要提速 <wbr>到底该听谁的？\n\n\n\n\n高铁票价会涨吗？谁说了算？\n\n\n\n在各界对高铁提速呼声不断高涨的大背景下，一个\\“顺理成章\\”且“呼之欲出”的议题势必然就是：高铁票价有可能因提速而上涨，涨多少？\n\n\n对于铁路运营部门来说，他们自然希望将提速所增加的成本转移到乘客身上；可对于旅客来讲，“提速不提价”自然最好。平心而论，依据一般市场定价规律，伴随高铁提速适当提高高铁票价，并没有什么不合理之处，也并非不可接受。但是，如何涨？涨多少？是不是提速幅度越大，高铁票涨价的幅度也越大？这些问题需要讲清楚。\n\n\n\n国家发改委今年2月份宣布，放开高铁动车票价，改由铁总自行定价。加价方式则要考虑到民意、主要乘客群体支付能力、市场竞争状况和客流分布等因素，进行综合考虑。显然，提价首先需要广泛听取民众的声音，在速度涨幅和票价涨幅间寻求一个最佳的平衡点。比如看看大多人为了提速10%，是否愿意多付10%的票价或者更多。\n\n\n评论丨高铁要不要提速 <wbr>到底该听谁的？\n\n\n\n\n高铁\\“提速\\”取决于经济发展和民众需求\n\n\n高铁是基础设施的一部分，提速的目的是更方便民众出行。但如果用涨价将一些人挡在高铁之外，那么提速的行为就有些本末倒置了。在高铁票价制定上出现偏差的话，可能会让一些人用脚投票，选择其他性价比更好的出行方式。而如果高铁运力由于票价的问题出现闲置，那才是对铁路资源更大的浪费。\n\n\n高铁\\“提速”取决于经济发展和民众需求，只有尽可能地兼顾不同人群的利益，最大限度地达到公共利益和商业利益的平衡，才是高速铁路成熟的标志。\n\n\n文丨央视评论特约撰稿王亚宏\n\n', null, null);
